関数は以下のように書きます。関数は値を受け取って処理を行うものなので、引数と返り値に注目すると分かりやすいと思います。 // 関数
fn function_1() { println!("Number = {}", 123);
} // 引数のある関数
fn function_2(x: i32) { println!("Number = {}", x);
} // 返り値のある関数
fn function_3(x: i32) -> i32 { x + 1
} 引数はカッコの中に、 func_name(x: Ty) のように変数 x の型 Ty をコロン : を間に挟んで書きます。 返り値は、func_name() -> Ty のように返り値の型 Ty を -> の後ろに書きます。 演習 問題へのリンク を開いて、コンパイルが通るように関数を書き加えてみましょう。 上の function_3 を真似してみましょう。 参考: TRPL: 関数 解答へのリンクはこちら

