ここでは、 if 式とループを学びます。 if 式は、論理値を用いて条件分岐するときに使います。 let x = 5; // 論理値を入れる
if x != 0 { println!("x is not 0.");
} // elseを使って2つに分岐
if x != 0 { println!("x is not 0.");
} else { println!("x is 0.");
} // else if を使って複数に分岐
if x > 0 { println!("x is +.");
} else if x < 0 { println!("x is -.");
} else { println!("x is 0.");
} // ifは式なので、値を返却できる
let y = if x > 0 { 10 // 値を返却するために `;` がつかないことに注意
} else { -10 // let variable = if cond { A } else { B }; の時、AとBは同じ型
}; ループは、loop, while, for の3つが使えます。 // loop: プログラムをCtrl+cで止めるまで永遠にループする
loop { println!("Hello!");
} // while: 条件式が`true`の間だけループする
let mut x = 5;
while x > 0 { println!("{}", x); x = x - 1;
} // for: 決められた固定回数だけループする。添字を使うループとして、配列を対象によく使われる
for i in 0..10 { println!("{}", i);
} if も for も、条件式やループの添字部分を () で囲うことがないのが特徴的ですね。 演習 問題へのリンク を開いて、コンパイルが通るように「ここを書き換えよ」というコメントのある行を書き換えよ。 なぜコンパイルが通らないのでしょうか？ 参考: TRPL: フロー制御 解答へのリンクはこちら リンク を見て、for文の使い方を学びましょう。 参考: Rust By Example: forループ 参考: keyword for 参考: rev() 参考: iter() Rustにはたくさんの便利なメソッドがあるので、やりたいことがあれば標準ライブラリのドキュメントを検索してみると良いでしょう。
